import styled from 'styled-components';

const RecipeFilterStyled = styled.div`
	text-align: center;
`;

function RecipeFilter() {
	return <RecipeFilterStyled>RecipeFilter</RecipeFilterStyled>;
}

export default RecipeFilter;
